let htmlItems = htmlJson.items;
let secItems = secJson.items;
let htmlLength = htmlItems.length;
let secLength = secItems.length;
let toggle = document.querySelector(".toggle");
let btnList = document.querySelector(".btnList");

// toggle function
toggle.addEventListener("click", () => {
  if (btnList.style.display == "none") {
    btnList.setAttribute(
      "style",
      "display:block; position:fixed; top:55px; width:50%;"
    );
  } else {
    btnList.setAttribute("style", "display:none");
  }
});


document.querySelector(".title").innerHTML = htmlItems[0].snippet.title;

for (let i = 0; i < htmlLength; i++) {
  let lessonBtn = document.createElement("button");
  let btnText = document.createTextNode(`Lesson ${i + 1}`);
  lessonBtn.classList.add("lessonBtn");
  lessonBtn.appendChild(btnText);
  btnList.appendChild(lessonBtn);
}
for (let i = 0; i < secLength; i++) {
  let secLessonBtn = document.createElement("button");
  let btnText = document.createTextNode(`Lesson ${i + 51}`);
  secLessonBtn.classList.add("secLessonBtn");
  secLessonBtn.appendChild(btnText);
  btnList.appendChild(secLessonBtn);
}
let lessonBtn = document.querySelectorAll(".lessonBtn");
for (let i = 0; i < htmlLength; i++) {
  lessonBtn[i].addEventListener("click", () => {
    document.getElementById(
      "videoFrame"
    ).src = `https://www.youtube.com/embed/${htmlItems[i].snippet.resourceId.videoId}?list=PL1ano0qwNuBwA90YwA-5d8g2wbOYHkl5h`;
    document.querySelector(".title").innerHTML = htmlItems[i].snippet.title;

  });
}
let secLessonBtn = document.querySelectorAll(".secLessonBtn");
for (let i = 0; i < secLength; i++) {
  secLessonBtn[i].addEventListener("click", () => {
    document.getElementById(
      "videoFrame"
    ).src = `https://www.youtube.com/embed/${secItems[i].snippet.resourceId.videoId}?list=PL1ano0qwNuBwA90YwA-5d8g2wbOYHkl5h`;
    document.querySelector(".title").innerHTML = secItems[i].snippet.title;

  });
}
